    @Override
    public void onCreate(SQLiteDatabase sql) {
        sql.execSQL(tUsuarios);
        sql.execSQL(tDepartamentos);
        sql.execSQL(tMunicipios);
        sql.execSQL(tFarmacias);
        sql.execSQL(tMedicamentos);
        sql.execSQL(dDepartamentos);
        sql.execSQL(dMunicipios);

        // Insert de Farmacias
        sql.execSQL(dFarmacias01);
        sql.execSQL(dFarmacias02);
        sql.execSQL(dFarmacias03);
        sql.execSQL(dFarmacias04);
        sql.execSQL(dFarmacias05);
        sql.execSQL(dFarmacias06);
        sql.execSQL(dFarmacias07);

        // Insert de Medicamentos
        sql.execSQL(dMedicamento01);
        sql.execSQL(dMedicamento02);
        sql.execSQL(dMedicamento03);
        sql.execSQL(dMedicamento04);
        sql.execSQL(dMedicamento05);
        sql.execSQL(dMedicamento06);
    }

    @Override
    public void onUpgrade(SQLiteDatabase sql, int oldVersion, int newVersion) {
        sql.execSQL("DROP TABLE "+TABLADepartamentos );
        sql.execSQL("DROP TABLE "+TABLAMunicipios);
        sql.execSQL("DROP TABLE "+TABLAFarmacias);
        sql.execSQL("DROP TABLE "+TABLAMedicamento);
        sql.execSQL("DROP TABLE "+TABLAUsuarios);

    }
